import React, { useRef } from "react";
import emailjs from "emailjs-com";
import Maps from "./Maps/Maps";


const Contact = () => {
     const form = useRef();

     const sendEmail = (e) => {
       e.preventDefault();

       emailjs.sendForm(
         "YOUR_SERVICE_ID",       // <- Reemplaza con tu Service ID
         "YOUR_TEMPLATE_ID",      // <- Reemplaza con tu Template ID
         form.current,
         "YOUR_PUBLIC_KEY"        // <- Reemplaza con tu Public Key
       ).then(
         (result) => {
           alert("Correo enviado con Ã©xito!");
           e.target.reset();
         },
         (error) => {
           console.error(error.text);
           alert("Error al enviar el correo.");
         }
       );
     };
  return (
    <div className="container my-5">
      <div className="row">
        <div className="col-12">
          <Maps />
          <h1 className="text-center mb-4">CONTACTO</h1>

          <div className="row">
            <div className="col-md-6 mb-4">
              <h3>Preguntas</h3>
              <p>
                Para cada tipo de preguntas, estratÃ©gias e instantales que forme filtramos H&H 250-0097 e sejam crianÃ§as, completa e formulada a informaciÃ³n.
              </p>

              <h3 className="mt-4">Cotizaciones:</h3>
              <p className="h4">(683) 303 2910</p>

              <h3 className="mt-4">QUEJAS Y SUGERENCIAS</h3>

              {/* Formulario */}
              <form ref={form} onSubmit={sendEmail}>
                <div className="row">
                  <div className="col-md-6 mb-3">
                    <label className="form-label">Nombre</label>
                    <input type="text" name="nombre" className="form-control" required />
                  </div>
                  <div className="col-md-6 mb-3">
                    <label className="form-label">Apellido</label>
                    <input type="text" name="apellido" className="form-control" required />
                  </div>
                  <div className="col-md-12 mb-3">
                    <label className="form-label">Correo electrÃ³nico</label>
                    <input type="email" name="correo" className="form-control" required />
                  </div>
                  <div className="col-md-12 mb-3">
                    <label className="form-label">TelÃ©fono</label>
                    <input type="tel" name="telefono" className="form-control" />
                  </div>
                  <div className="col-md-12 mb-3">
                    <label className="form-label">Mensaje</label>
                    <textarea name="mensaje" className="form-control" rows="4" required></textarea>
                  </div>
                </div>
                <button type="submit" className="btn btn-primary mt-2">Enviar</button>
              </form>

            </div>

            <div className="col-md-6 mb-4">
              <h3>Empleos</h3>
              <p>
                Para aplicar a un trabajo en IMAGE, evita su CV y usa por encaminhadas se funcionalizadas:
              </p>

              <h3 className="mt-4">Para selecciÃ³n de equipos, segundos, cotizaciones y comentarios relacionados a:</h3>
              <p className="h5">click@image.com</p>
              <p className="h5">Sigunda en cero</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
